import React, { useState } from "react";

function App() {
  return (
    <div>
      <header>
        <div className="header">
          <div className="profile">
            <h3>Hello, John!</h3>
          </div>
          <h3 id="logout">Log out</h3>
        </div>
      </header>
      <h1>John's To Do List!</h1>
      console.log("John")
    </div>
  );
}

export default App;
